function toggleDropdown(e){document.getElementsByClass("dropdown-content").style.display="none",e.nextElementSibling.classList.toggle("show")}function filterFunction(e){var n,t,l;for(n=e.value.toUpperCase(),div=e.nextElementSibling,t=div.getElementsByTagName("a"),l=0;l<t.length;l++)t[l].innerHTML.toUpperCase().indexOf(n)>-1?t[l].style.display="":t[l].style.display="none"}